import React from 'react'

function ListDetail() {
  return (
    <div>
       <div>
        {filteredData.map((item, i) => (
          <div key={i}>
            <input
              type="checkbox"
              checked={item.completed}
              onChange={() => SetTodoChange(item)}
            />
            <span>{item.data}</span>
            <button onClick={() => SetDelete(item)}>X</button>
          </div>
        ))}
      </div>
    </div>
  )
}

export default ListDetail
